import React from 'react';
import {links, media} from '../Utils/consts';

const Navbar = () => {
    const pages = links;
    const socMedia = media;

    console.log(pages, socMedia);

    return (
        <div id='navbar'>
            <div id='logo'>
                CO. Name
            </div>
            <div id='pages'>
                {
                    pages.map((page) => {
                        return <p>{page.name}</p>
                    })
                }
            </div>
        </div>
    )
}

export default Navbar
